ads.description:
Samochód w bardzo dobrym stanie, bez wkładu finansowego, wszystko działa.   Sprzedaję tylko i wyłącznie dlatego, że kupiłem nowy samochód.  Bardzo wygodny samochód.   Zużycie gazu wynosi 10 litrów.  Wymiana oleju co 6000 km.  Silnik pracuje bardzo cicho.  

W trakcie eksploatacji wymieniono:

- Tarcze hamulcowe tyl + łożyska kół;

- Łączniki stabilizatora przedniego;

- Poduszki amortyzatorów przod;

- Łożyska amortyzatorów obrotowe z przodu;

- Filtr LPG;

- Osłona przegubu przod;

- Sworzeń wahacza przod;

- Prowadnice zaciskow hamulcow tył;

- Filtr paliwa;

- Przewódy hamulcow tył;

- Nowa oslona rozrzadu;

- Uszczelki wału korbowego;

- Uszczelki wałkow rozrządu;

- Koło zmiennych faz rozrządu;

- Zestaw rozrządu;

- Pompa wodna;

- Zwijak AIRBAG kierownicy - PANEL + TAŚMA z wtyczkami;

- Amortyzatory przód;

- Uszczelki kolektora dolotowego;

- Uszczelka przepustnicy;

- Uszczelka ODMY;

- Termostat.

Zapraszam na jazdę próbne. 

Ubezpieczenie do 26.05.2025

Przegląd do 20.09.2025

Butla LPG do 2029
